import { Component } from 'react';
import { connect } from 'react-redux';
import { bindActionCreators } from 'redux';
import { withRouter } from 'next/router';
import Header from 'components/header';
import HeroBanner from 'components/herobanner';
import Layout from 'components/layout';
import PageHeader from 'components/pageheader';

import styles from './Classes.scss';

import PropTypes from 'prop-types';

class Classes extends Component {
	static getInitialProps ({ reduxStore, req }) {
		const isServer = !!req

		return {}
	}

	static propTypes = {
		router: PropTypes.object,
	}

	render() {
		const {
			router
		} = this.props;

		return (
			<>
				<Header router={router} />
				<HeroBanner 
					className={styles('herobanner')}
					title='Classes' 
					text_position={HeroBanner.TextPosition.BOTTOM}

					background_image='https://lh3.googleusercontent.com/VPa4bWy1EsEk7bNK1crXBTZ9iyc_afjPcdDkZEJF_4YczT-35VbrFUagBGrA4pXraR2RJNtU5L5Z7bGELIvNxRAXYmFG8NGtjI4eJM3ezyB8khC7S6xMu7qMCOrhLXXGcyExf_Y2YCQXUnljMTD-r9ySYi6yFPaB_zeHT9uUIneW02S0gTB0mz8hf3rv2qwE7wRXKS4ff3jePNzXvY34OdDrH_pd0gqowgfPaKRhSYNwqHF2uCm98xVnIq_tQrMdCr2h3YBeUVoUhQQoafey49ZjYzRFAtHnRdXsnAXcEC2KuIC-9M4APaTU7JpoxR79dK5wqAXtlOLL1Oo5mx147zRa0euTiK6CncDYJz5LeLPYUxTEbP-DgT5YezuIANfuZD-3bE6QPJyjipJLgCLIdANW7Fb38bQJxhCfaD-sdDXUPTLthwNynCjOb2lgdHkwqxqCl5Hzz9bi3vD3WrFgj9uzb7EnSNRURPVaO4dI--pBifBwqb8vUdjTwtWA2mb4A-Rx0PuuZK5J5dqpzgvhIBMivBBnRQSZBdhTlWbyOj0fRYfRg7Pmv1m71m0bC3XuXNLbNaNFYopYeJEmLpmvzTKkm4ywEkmbRrtrQnyBE2JPg8eNBwhm3M5VZwgIgBXsnjxqvVfBDiL0J8WxnPae2wcZBLUXuwNt4uRVLdh9NzQC75fwXRBnuQs=w462-h346-no'
					background_position={HeroBanner.BackgroundPosition.CENTER}
					hero_height={HeroBanner.HeroHeight.HALF} 
					gradient={HeroBanner.Gradient.BOTTOM}
				/>
				<Layout>
					<PageHeader 
						title='Classes'
					/>
					<div className={styles('content')} />
				</Layout>
			</>
		)
	}
}

export default withRouter(Classes);
